CREATE TABLE public.s_users (
	id_user int8 NOT NULL DEFAULT nextval('s_users_seq'::regclass),
	username varchar(255) NOT NULL,
	"password" varchar(255) NOT NULL,
	email varchar(255) NOT NULL,
	fullname varchar(255) NOT NULL,
	active bool NOT NULL,
	CONSTRAINT s_user_email_key UNIQUE (email),
	CONSTRAINT s_user_pkey PRIMARY KEY (id_user),
	CONSTRAINT s_user_username_key UNIQUE (username)
);

CREATE TABLE public.s_roles (
	id_role varchar(36) NOT NULL,
	"name" varchar(255) NOT NULL,
	"label" varchar(255) NOT NULL,
	CONSTRAINT s_role_name_key UNIQUE (name),
	CONSTRAINT s_role_pkey PRIMARY KEY (id_role)
);

CREATE TABLE public.s_user_roles (
	id_user int8 NOT NULL,
	id_role varchar(36) NOT NULL,
	CONSTRAINT s_user_role_pkey PRIMARY KEY (id_user, id_role),
	CONSTRAINT s_user_role_id_role_fkey FOREIGN KEY (id_role) REFERENCES s_roles(id_role),
	CONSTRAINT s_user_role_id_user_fkey FOREIGN KEY (id_user) REFERENCES s_users(id_user)
);

CREATE TABLE public.s_users_details (
	id int8 NOT NULL GENERATED BY DEFAULT AS IDENTITY,
	no_hp varchar(13) NULL,
	foto_profil varchar(216) NULL,
	alamat varchar(2048) NULL,
	id_user int8 NULL,
	CONSTRAINT s_users_details_pk PRIMARY KEY (id),
	CONSTRAINT s_users_details_un UNIQUE (id_user),
	CONSTRAINT s_users_details_fk FOREIGN KEY (id_user) REFERENCES s_users(id_user) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE public.oauth_access_token (
	token_id varchar(256) NULL,
	"token" bytea NULL,
	authentication_id varchar(256) NULL,
	user_name varchar(256) NULL,
	client_id varchar(256) NULL,
	authentication bytea NULL,
	refresh_token varchar(256) NULL
);

CREATE TABLE public.oauth_client_token (
	token_id varchar(256) NULL,
	"token" bytea NULL,
	authentication_id varchar(256) NULL,
	user_name varchar(256) NULL,
	client_id varchar(256) NULL
);

CREATE TABLE public.oauth_refresh_token (
	token_id varchar(256) NULL,
	"token" bytea NULL,
	authentication bytea NULL
);

CREATE TABLE public.oauth_client_details (
	client_id varchar(256) NOT NULL,
	resource_ids varchar(256) NULL,
	client_secret varchar(256) NULL,
	"scope" varchar(256) NULL,
	authorized_grant_types varchar(256) NULL,
	web_server_redirect_uri varchar(256) NULL,
	autoapprove varchar(256) NULL,
	access_token_validity numeric(11) NULL DEFAULT NULL::numeric,
	refresh_token_validity numeric(11) NULL DEFAULT NULL::numeric,
	authorities varchar(256) NULL DEFAULT NULL::character varying,
	additional_information varchar(4096) NULL DEFAULT NULL::character varying,
	CONSTRAINT oauth_client_details_pkey PRIMARY KEY (client_id)
);

CREATE TABLE public.dat_notif_user (
	username varchar(255) NOT NULL,
	email varchar(255) NOT NULL,
	expired_date timestamptz(0) NOT NULL,
	id_user int8 NOT NULL,
	"action" varchar(32) NOT NULL,
	id int8 NOT NULL GENERATED BY DEFAULT AS IDENTITY
);

CREATE TABLE public.dat_cart (
	id int8 NOT NULL GENERATED BY DEFAULT AS IDENTITY,
	id_user int8 NOT NULL,
	CONSTRAINT dat_cart_pk PRIMARY KEY (id),
	CONSTRAINT dat_cart_un UNIQUE (id_user),
	CONSTRAINT dat_cart_fk FOREIGN KEY (id_user) REFERENCES s_users(id_user)
);

CREATE TABLE public.dat_kategori_produk (
	id varchar(4) NOT NULL,
	kategori varchar(128) NULL,
	CONSTRAINT dat_kategori_produk_pk PRIMARY KEY (id)
);

CREATE TABLE public.dat_produk (
	id varchar(5) NOT NULL DEFAULT to_char(nextval('produk_seq'::regclass), '"P"fm000'::text),
	kategori_produk varchar(4) NULL,
	nama_produk varchar(512) NULL,
	harga_produk numeric(15) NULL,
	stok_produk numeric(4) NULL,
	foto_produk1 varchar(512) NULL,
	foto_produk2 varchar(512) NULL,
	foto_produk3 varchar(512) NULL,
	foto_produk4 varchar(512) NULL,
	foto_produk5 varchar(512) NULL,
	deskripsi_produk varchar NULL,
	CONSTRAINT produk_pkey PRIMARY KEY (id),
	CONSTRAINT dat_produk_fk FOREIGN KEY (kategori_produk) REFERENCES dat_kategori_produk(id) ON UPDATE CASCADE ON DELETE RESTRICT
);

CREATE TABLE public.dat_cart_produk (
	id_cart int8 NOT NULL,
	id_produk varchar(5) NOT NULL,
	jumlah_item numeric(5) NULL,
	id int8 NOT NULL GENERATED BY DEFAULT AS IDENTITY,
	CONSTRAINT dat_cart_produk_pk PRIMARY KEY (id),
	CONSTRAINT dat_cart_produk_fk FOREIGN KEY (id_produk) REFERENCES dat_produk(id) ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT dat_cart_produk_fk_1 FOREIGN KEY (id_cart) REFERENCES dat_cart(id) ON UPDATE CASCADE ON DELETE CASCADE
);

